import React from 'react';
import './index.css'; 
import company from './company.png';

const About = () => {
    return (
        <div className="about-container">
            <div className="about-content">
                <h1>About Our Company</h1>
                <p>
                    Welcome to [Your Company Name], where we are dedicated to providing exceptional services and products to our clients. 
                    Founded in [Year], our mission is to [briefly describe your mission or goals]. 
                    We are committed to excellence and strive to [mention key aspects of your service or values].
                </p>
                <p>
                    Our team consists of experienced professionals who are passionate about [industry or field]. 
                    We believe in [mention key values or approaches]. 
                    Thank you for choosing [Your Company Name]. We look forward to serving you!
                </p>
            </div>
            <div className="about-image">
                <img src={company} alt="Company" />
            </div>
        </div>
    );
};

export default About;
